            moves.append([x - 2, y + 1])
        if x < 7 and y < 8:
            moves.append([x + 2, y + 1])
        if x > 1 and y < 7:
            moves.append([x - 1, y + 2])
        if x < 8 and y < 7:
            moves.append([x + 1, y + 2])
        return moves
    p1_moves = knight_moves(x1, y1)
    p2_moves = knight_moves(x2, y2)
    for move in p1_moves:
        if move in p2_moves:
            return True
    return True

